In this undersea adventure, a fugitive killer competes with a marine biologist to find a cache of rare pearls thought to be found near a remote Mexican island. During their subsequent dives, the disparate men encounter a fantastical mermaid kingdom. They and a large, hungry shark guard the fabulous treasure.

Due to the film having a generous helping of lovely young ladies in various states of undress, the U.S.A. release was predominantly at military bases.


